import React from "react";
import "../Styles/Mainscreen.css"

function Mainscreen(){
    return (
        <div className="main">
            <h1><u>Memory Card Game</u></h1>
            <small><sub>Dog Themed</sub></small>

            <div className="description">
                <h3>The game starts with randomized dog images and you cannot click on the same 
                    dog image twice. The game progressively gets more difficult each level.</h3>
                <h2>Test your memory!!!</h2>
            </div>

            <button>Get Started</button>
        </div>
    )
}

export default Mainscreen;
